हम उम्मीद और प्रार्थना करते हैं कि #CoronaVirus का कहर थम जाए , हम हर किसी को सुरक्षित रखने के लिए जो सबसे आसान काम कर सकते हैं वो है हाथों की रोज़ाना अच्छे से सफाई करना।

#COVIDー19 के खिलाफ लड़ाई में चौबीसों घंटे काम करने वाले सभी अधिकारियों के प्रयासों को सलाम।
@UNICEF  @WHO

सध्या वाढत असलेला #CoronaVirus चा प्रसार थांबावा अशी जरी आपण आशा करत असलो तरी सुरक्षित राहण्याचा सोपा उपाय म्हणजे सर्वांनी आपले हात व्यवस्थित आणि नियमीतपणे धुवावेत.
तसेच #COVIDー19 विरूद्ध न थांबता लढणाऱ्या सर्व अधिकाऱ्यांच्या प्रचंड प्रयत्नांना सलाम.

@UNICEF @WHO

